    to a row from the form table.
  remarks: >-
    Please use this class instead of a full <xref href="SuperOffice.CRM.Rows.FormRow" data-throw-if-not-resolved="false"></xref> object when

    you do not need to <b>create or update</b> a value in the database. Row objects have a large overhead

    since they carry the corresponding <xref href="SuperOffice.CRM.Data.FormTableInfo" data-throw-if-not-resolved="false"></xref> object, which

    in turn defines fields and aliases; there may be a Sentry on a row, and various other helper objects.
